#!/usr/bin/env python3

# Reverse complement a DNA string

dna = ''

compl = dna.replace('A'.upper(),'t'.lower())
compl = compl.replace('C'.upper(),'g'.lower())
compl = compl.replace('G'.upper(),'c'.lower())
compl = compl.replace('T'.upper(),'a'.lower())

rev_compl = compl[::-1]

print(rev_compl.upper())
